@prefix : <http://example.com#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ATM a owl:Class .

:OverdraftWithdrawal a owl:Class ;
  owl:equivalentClass [ 
      a owl:Class ; 
      owl:intersectionOf ( 
          :Withdrawal 
          [ a owl:Restriction ; 
            owl:onProperty :HasNegativeBalance ;
            owl:someValuesFrom xsd:boolean 
          ] 
      ) 
  ] .

:AuthorizedOverdraftWithdrawal a owl:Class ;
  owl:equivalentClass [
      a owl:Class ; 
      owl:intersectionOf ( 
          :OverdraftWithdrawal 
          [ a owl:Restriction ; 
            owl:onProperty :isAuthorized ;
            owl:hasValue true 
          ] 
      ) 
  ] .

:PreventOverdraftWithdrawalUnlessAuthorized a owl:Class ;
  owl:equivalentClass [
      a owl:Class ;
      owl:intersectionOf (
          :ATM
          [ a owl:Restriction ;
            owl:onProperty :Prevents ;
            owl:someValuesFrom :OverdraftWithdrawal
          ]
          [ a owl:Restriction ;
            owl:onProperty :Allows ;
            owl:someValuesFrom :AuthorizedOverdraftWithdrawal
          ]
      )
  ] .
